import React from "react"

function Header(){
    fetch('https://images-api.nasa.gov',{
        method: 'GET',
        headers:{
            'Accept':'application/json',
            'Content-Type':'application/json',
        },
    })
     .then((res) => res.json)
     .then((data) => {
         return "aeresfsdf";
     })
     //console.log(data);
}

export default Header
